import React from 'react';
import { Link } from 'react-router-dom';

function MainPage() {
  return (
    <div>
      <h1>Welcome to the Main Page</h1>
      <Link to="/second-page">
        <button>Go to Second Page</button>
      </Link>
    </div>
  );
}

export default MainPage;
